#include <iostream>
#include <vector>
#include <stack>
#include <algorithm>
#include <limits>
#include <queue>
#include <map>

using namespace std;

struct Pos {
    int x;
    int y;
    Pos() : x(0), y(0) {}
    Pos(int a, int b) : x(a), y(b) {}
};

class Solution {
    public:
        bool check(vector<vector<char> > &board, int i, int j, int flag, vector<Pos> &v){
            /*Set board[i][j] as 'C' to make sure it does not been re-check.
             * return true if scanned point should be set as X.
             */
            int m = board.size(), n = board[0].size();
            bool ret  = true;

            if (board[i][j] == 'T')
                return false;
            else if (board[i][j] == 'X'||board[i][j] == 'C')
                return true;

            //board[i][j] == 'O';
            if (i == m-1 || i == 0 || j == 0 || j == n-1)
                return false;

            //right check
            if (flag == -1|| flag != 2) {
                v.push_back(Pos(i, j));
                board[i][j] = 'C';
                ret = check(board, i, j+1, 0, v);
                if (ret == false)
                    return false;
            }


            if (flag == -1|| flag != 3) {
                v.push_back(Pos(i, j));
                board[i][j] = 'C';
                ret = check(board, i+1, j, 1, v);
                if (ret == false)
                    return false;
            }

            if (flag == -1|| flag != 0) {
                v.push_back(Pos(i, j));
                board[i][j] = 'C';
                ret = check(board, i, j-1, 2, v);
                if (ret == false)
                    return false;
            }
            if (flag == -1|| flag != 1) {
                v.push_back(Pos(i, j));
                board[i][j] = 'C';
                ret = check(board, i-1, j, 3, v);
                if (ret == false)
                    return false;
            }

            return true;
        }
        void solve(vector<vector<char> > &board) {
            for (int i = 0; i < board.size(); i ++)
                for (int j = 0; j <board[i].size(); j++){
                    vector<Pos> v;;
                    v.clear();
                    if (board[i][j] != 'O') continue;
                    bool r = check(board, i, j, -1, v);
                    if (r == false){
                        board[i][j] = 'T';
                        for (int k = 0; k < v.size(); k++)
                            board[v[k].x][v[k].y] = 'T';
                    } else{
                        for (int k = 0; k < v.size(); k++)
                            board[v[k].x][v[k].y] = 'X';
                    }
                }

            for (int i = 0; i < board.size(); i ++)
                for (int j = 0; j <board[i].size(); j++){
                    if (board[i][j] == 'T')
                        board[i][j] = 'O' ;
                }

        }
};
